using System;
using System.Collections;
using System.Collections.Generic;
using System.Globalization;
using System.IO;
using System.Linq;
using System.Reflection;
using System.Resources;
using System.Windows.Media.Imaging;
using PRM.Core.Model;
using Shawn.Utils;

namespace PRM.Core.Protocol
{
    public class ServerIcons
    {
        #region singleton

        private static ServerIcons uniqueInstance;
        private static readonly object InstanceLock = new object();

        public static ServerIcons Instance
        {
            get
            {
                lock (InstanceLock)
                {
                    if (uniqueInstance == null)
                    {
                        uniqueInstance = new ServerIcons();
                    }
                }
                return uniqueInstance;
            }
        }

        #endregion singleton

        private ServerIcons()
        {
            var type = typeof(ServerIcons);
            var fields = type.GetFields(BindingFlags.NonPublic | BindingFlags.Static);
            foreach (var field in fields)
            {
                if (field.FieldType == typeof(string))
                {
                    try
                    {
                        var str = (string)field.GetValue(this);
                        var img = NetImageProcessHelper.BitmapFromBase64(str);
                        Icons.Add(img.ToBitmapImage());
                    }
                    catch (Exception)
                    {
                    }
                }
            }

            string iconFolderPath = SystemConfig.Instance.General.IconFolderPath;
            var di = new DirectoryInfo(iconFolderPath);
            if (di.Exists && di.GetFiles().Length > 0)
            {
                var jpgs = di.GetFiles("*.jpg");
                var pngs = di.GetFiles("*.png");
                var bmps = di.GetFiles("*.bmp");
                var icons = di.GetFiles("*.icon");
                var imgs = jpgs.Union(pngs).Union(icons).Union(bmps);
                foreach (var fileInfo in imgs)
                {
                    var bs = NetImageProcessHelper.ReadImgFile(fileInfo.FullName);
                    if (bs != null)
                        Icons.Add(bs.ToBitmapSource());
                }
            }
            else if (!di.Exists)
                di.Create();

            string resourceName = this.GetType().Assembly.GetName().Name + ".g";
            ResourceManager mgr = new ResourceManager(resourceName, this.GetType().Assembly);
            using (ResourceSet set = mgr.GetResourceSet(CultureInfo.CurrentCulture, true, true))
            {
                foreach (DictionaryEntry each in set)
                {
                    if (each.Key.ToString().StartsWith("resources/icons/", true, CultureInfo.CurrentCulture)
                    && ".png" == Path.GetExtension(each.Key.ToString()).ToLower())
                    {
                        var s = (UnmanagedMemoryStream)set.GetObject(each.Key.ToString(), true);
                        var img = BitmapFrame.Create(s, BitmapCreateOptions.None, BitmapCacheOption.OnLoad);
                        var bm = img.ToBitmap();
                        Icons.Add(bm.ToBitmapSource());
                    }
                }
            }
        }

        private const string Windows7 = "";
        private const string Win7 = "";
        private const string Win2003 = "";
        private const string Win2008 = "";
        private const string Win8 = "";
        private const string Windows10 = "";
        private const string Win2012 = "";
        private const string Win2016 = "";
        private const string Win10 = "";
        private const string T_Wordpress = "";
        private const string T_PHP = "";
        private const string T_Nginx = "";
        private const string T_Gogs = "";
        private const string T_Gitlab = "";
        private const string T_GitHub2 = "";
        private const string T_GitHub1 = "";
        private const string T_Gitea = "";
        private const string T_Docker2 = "";
        private const string T_Docker1 = "";
        private const string M_Hp2 = "";
        private const string M_Hp1 = "";
        private const string M_Apple = "";
        private const string L_Ubuntu = "";
        private const string L_RedHat = "";
        private const string L_RaspberryPi = "";
        private const string L_Linux = "";
        private const string L_Centos = "";
        private const string L_Arch = "";
        private const string Env_Python = "";
        private const string Env_Java = "";
        private const string Env_DotNet = "";

        public List<BitmapSource> Icons { get; set; } = new List<BitmapSource>();
    }
}